import React from 'react';
import axios from 'axios';
import SearchBar from './SearchBar';

class AxiosSearch extends React.Component {
    images = [];
  async onSearchSubmit(term) {
      axios
      .get('https://api.unsplash.com/search/photos', {
          params: {query: term},
          headers: {
              Authorization: 'Client-ID LV6VY88M75l5IvWUJp5aKDIBpB1bI97YIr8PW3h_bas' //need to get key
          }
      })
      .then (response => {
        console.log(`onSearchSubmit ${JSON.stringify(response.data.results, null, 2)}`);
        console.log(`onSearchSubmit ${response.data.results[0].urls.raw}`);
        console.log(`onSearchSubmit Length: ${response.data.results.length}`);
        response.data.results.map((item, index) =>
            console.log(`BOOM!!! ${index} => ${item.urls.raw}`)
        )
      });
  }  
  render() {
      return (
          <div className="ui container" style={{ marginTop: '10px'}}>
            <SearchBar onSubmit={this.onSearchSubmit} />
          </div>
      )
  }
}
export default AxiosSearch;
